description:
An invisible and mysterious force field descends upon a small fictional town in the United States, trapping residents inside, cut off from the rest of civilization. The trapped townsfolk must discover the secrets and purpose of the &quot;dome&quot; and its origins, while coming to learn more than they ever knew about each other.

